import 'primeicons/primeicons.css';
import 'primereact/resources/themes/saga-blue/theme.css';
import 'primereact/resources/primereact.css';
import 'primeflex/primeflex.css';
// import '../../index.css';
import ReactDOM from 'react-dom';
import Logo from '../../'
import React, { Component } from 'react';
import { Menubar } from 'primereact/menubar';
import { InputText } from 'primereact/inputtext';

 class NavBar extends Component {

    constructor(props) {
        super(props);

        this.items = [
            {
                label: 'Home',
                icon: 'pi pi-home'
            },
            {
                label: 'Services',
                items: [
                    {
                        label: 'Bedrooms',
                        items: [
                            {
                                label: 'Master Bedroom'
                            },
                            {
                                label: 'Children Bedroom'
                            },
                            {
                                label: 'Guest Bedrrom'
                            },
                            {
                                label: 'parent Bedroom'
                            }

                        ]
                    },
                    {
                        label: 'Kitchen',
                        items : [
                            {
                                label :"U Shaped"
                            },
                            {
                                label :"L Shaped"
                            },
                            {
                                label :"Parallel Kitchen"
                            },
                            {
                                label :"Island Kitchen"
                            },
                            {
                                label : "Straight Kitchen"
                            },
                            {
                                label : "Modular Kitchen"
                            }
                        ]
                    },
                    // {
                    //     separator: true
                    // },

                ]
            },
            {
                label: 'How It Works'
            },
            {
                label : 'Loactions',
                items : [
                    {
                        label : 'Hyderabad'
                    },
                    {
                        label :'Bangalore'
                    },
                    {
                        label :'Ananatapur'
                    },
                    {
                        label : 'All Locations In AndhraPradesh'
                    }
                ]
            },
            {
                label: 'Contact Us'
            }
        ];
    }

    render() {
        const start = <img alt="logo" src="showcase/images/logo.png" onError={(e) => e.target.src='https://www.primefaces.org/wp-content/uploads/2020/05/placeholder.png'} height="40" className="p-mr-2"></img>;

        return (
            <div className="Navbars">
                <div className='p-grid contact-details-navbar'>
                    <div className='p-col-6'>

                    </div>
                    <div className='p-col-6'>

</div>
                </div>
                <div className="card">
                    <Menubar model={this.items} end={start}  />
                </div>
            </div>
        );
    }
};
export default NavBar;
